protected static String joinMap(Map<String, ?> map,
    String prefix,
    String middle, String suffix) {
  if (map == null) {
    return "";
  }
  List<String> list = new ArrayList<>(map.keySet());
  Collections.sort(list);
  StringBuilder sb = new StringBuilder(list.size() * 32);
  for (String k : list) {
    sb.append(prefix)
        .append(k)
        .append(middle)
        .append(map.get(k))
        .append(suffix);
  }
  return sb.toString();
}
